import React from 'react'
import { Link } from 'react-router-dom';

const Curriculum = () => {
    return (
        <div>
            <span>Curriculum</span>
            <Link to={'./IndexPage'}>Back to Home Page</Link>
        </div>
    );
};

export {Curriculum};
